import "./post.css";

const Post = () => {
  return (
    <div className="post">
      <div className="postWrapper">
        <div className="postTop">
          <img src="/assets/person/1.jpeg" alt="" className="profileImage" />
          <div className="postInfo">
            <p>
              <strong className="strongInfo">Joanna Doe</strong> is at{" "}
              <strong className="strongInfo">New York</strong>
            </p>
            <p className="timeInfo">2m ago, New York, Broadway</p>
          </div>
        </div>
        <div className="postMain">
          <p className="postText">Image Description/Text of the post</p>
          <img src="/assets/post/1.jpeg" alt="" className="postImage" />
        </div>

        <div className="postBottom"></div>
      </div>
    </div>
  );
};

export default Post;
